	const navigateToCustomer = () => {
		 navigate('/Customer');
	}

	const navigateEmployee =() => {
		 navigate('/employee');
	}


    return (
        <div class="home">
            <img src={logo} alt="spanky's logo" class="logo"></img>
            <Typography variant="h4">I am a ...</Typography>
